import React, { useState } from 'react';
import { LoginForm } from '../../blocks';
import { List, Login, Cart } from './styles';
import { loadUsers } from "../../../model/users";

export interface IUserNavProps {
  width?: string;
  className?: string;
}

const UserNav: React.FC<IUserNavProps> = ({ width, className }) => {
  const [popup, setPopup] = useState(false);

  return (
    <List className={className} width={width}>
      <li key='1'>
        <Login onClick={() => {
          console.log('open');
          loadUsers();
          setPopup(true);
        }}>
          Войти
        </Login>
        <LoginForm isOpen={popup} setOpen={setPopup} />
      </li>
      <li key='2'>
        <Cart>
          <p>Корзина</p>
        </Cart>
      </li>
    </List>
  )
};

export default UserNav;
